"use strict";(self.webpackChunkgrc=self.webpackChunkgrc||[]).push([[3347],{82070:e=>{e.exports=JSON.parse('{"abstract":"Traditional memory performance metrics, such as average memory access time\\n(AMAT), are designed for sequential data accesses and can prove misleading for\\ncontemporary cache technologies that increasingly rely on access concurrency.\\nC-AMAT, a new performance metric, accounts for concurrency at both the\\ncomponent and system levels for modern memory design.","authors":["X.-H. Sun","D. Wang"],"date":"May, 2014","doi":"10.1109/mc.2013.227","links":{"bibtex":"http://cs.iit.edu/~scs/assets/files/sun2014concurrent.bib","citation":"http://cs.iit.edu/~scs/assets/files/sun2014concurrent.txt","pdf":"http://cs.iit.edu/~scs/assets/files/SUN-ConcurrentAMAT__IEEE_May2014.pdf"},"month":5,"slug":"sun-2014-concurrent-average-f9f1","tags":[],"title":"Concurrent Average Memory Access Time","type":"Journal","venue":"IEEE Computer, vol. 47, no. 5, pp. 74-80","year":2014}')}}]);